import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: #f0f0f0;
`;

const Home = () => {
  return (
    <HomeContainer>
      <h1>Welcome to My Portfolio</h1>
      <p>This is the Home Page.</p>
    </HomeContainer>
  );
};

export default Home;
